import "./speak-button.css";

//we can destructure the props diretly in the parameter and provide default values
function alertButton(props) {
 const {message} = props;
  return 
    <button className="speak-button" onClick={props}>
      alert "{message}"
    </button>
  
}
export default alertButton;
